import React, { Component } from 'react';
import styles from './Landing.module.css';

export default class Landing extends Component {
  render() {
    return (
      <section>
        <div className={styles.container}>
          <div className={styles.header}>
            Landing
          </div>
        </div>
      </section>
    )
  }
}
